      if os.path.exists(file+".out"):outfile = open(file+".out","r")
      else: outfile = open(file+".log","r")
      outlines = outfile.readlines()
      getFORMAT(self, outlines)
      getATOMTYPES(self, outlines, self.FORMAT)
